tables.table_schema:
CREATE TABLE HealthInterventions (
    intervention_id INT PRIMARY KEY,
    intervention_name VARCHAR,
    target_population VARCHAR,
    intervention_budget DECIMAL
);

CREATE TABLE high_risk_populations (
    id INT PRIMARY KEY,
    population_name VARCHAR(50),
    risk_level INT
);

CREATE TABLE health_interventions (
    id INT PRIMARY KEY,
    intervention_name VARCHAR(50),
    target_group VARCHAR(50),
    effectiveness_score FLOAT
);
